import Popup from 'reactjs-popup';

const PopUp = ({ open }) => {

    return (
        <Popup open={open} modal>
            {() => (
                <>
                    <button onClick={() => this.props.setOpen(false)}>
                        close
                    </button>
                </>
            )}
        </Popup>
    )
}

export default PopUp;
